import React, { Component } from "react";
import Form from "../components/form";
import Footer from "../components/footer";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <Form />
        <Footer />
      </div>
    );
  }
}

export default Home;
